import { NavLink } from 'react-router-dom';
const Timeline = () => {
    return (
        <div className="container">
            <div class="row">
                <table className="tableRedonda" >
                    <div class="col"></div>
                    <div class="col"></div>
                    <div class="col"></div>
                </table>         
            </div>
        </div>
    )
}

export default Timeline
